import React from "react";
import Text from "./Text";

const App = () => {
  return (
    <div>
      <h1 id="important">Hello world</h1>
      <Text name="Luna" animal="Dog" breed="Havanese" />
      <Text name="pop" animal="Bird" breed="cockatiel" />
    </div>
  );
};

export default App;
